import React from 'react';

function TransactionItem({ transaction, onDelete }) {
  console.log(`transaction::${JSON.stringify(transaction)}`);
  
  return (
    <div>
      <button onClick={onDelete}>Удалить</button>
    </div>
  );
}

export default TransactionItem;
